eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n// Module\nvar code = \"<hr>\\n<p>title: 우아한테크코스 레벨 5 회고\\nsubTitle: 어... 끝났다?\\ndate: 2022-12-15</p>\\n<hr>\\n<h2 id=\\\"네-수료요\\\">네? 수료요?</h2>\\n<blockquote>\\n<p>레벨 4가 정말로 끝날때쯤에 한 번 더 회고를 쓸텐데</p>\\n<p>『우아한테크코스 레벨 4 절반 회고』 中</p>\\n</blockquote>\\n<p>누구에게나 그럴듯한 계획은 있다. <strong>다만 이루지 못했을 뿐.</strong> 정신을 차리고보니 레벨 4는 끝난지 오래였고 어느새 레벨 5까지 휘리릭 지나가버렸다. 성적이 없는 교육을 지향하신 캡틴 포비의 말처럼 성적표 대신 자필로 쓰신 편지가 들어있는 수료증과 함께 내 우테코 생활도 마침표를 찍게 되었다. 짧은 단위의 회고를 적으려던 이 블로그의 취지가 무색하게도 레벨을 한 움큼씩 건너 뛴 지금에야 마무리 회고를 적고 있자니 기분이 영 찝찝하지만, 덮어놓고 있으면 지난 회고와의 간극이 더더욱 벌어지기만 할 뿐이라 억지로라도 키보드를 잡았다.</p>\\n<p><img src=\\\"https://pbs.twimg.com/media/FiZvJDYaYAASIQs?format=jpg&name=small\\\" alt=\\\"우테코 수료증과 기념품들\\\"></p>\\n<h2 id=\\\"취준생\\\">&#39;취준생&#39;</h2>\\n<p>우테코는 레벨마다 해결해야 할 과제들을 주고, 이를 수행하는 형식으로 진행된다. 적어도 레벨 4까지는 그랬다.</p>\\n<p>레벨 5에 들어오면서 적어도 프론트엔드는 아무런 미션도, 팀 프로젝트의 목표도, 심지어는 LMS의 강좌마저 개설되지 않았다. 백엔드는 미션이 계속 있어서 고통스러워하며 미션을 수행하고 있던데, 프론트엔드는 그나마도 없어서 방목 상태라는 말이 가장 어울리는 상황이었다.</p>\\n<p>바쁘게 취업 준비를 병행하는 크루들도 있었지만 여기서 나는 팀 프로젝트의 마무리에 더 집중하기로 했다. 여러가지 이유가 있는데, 첫 번째는 이 팀원들과 조금 더 협업을 해보고 싶었고, 두 번째는 당장 취업이 급하지 않았기 때문이다. 정확히는 취업하기가 어려웠다고 해야할까. 졸업까지 학기가 애매하게 남아 취업을 하더라도 짧으면 1년, 길어봐야 2년 안에는 다시 돌아와야 하는 상황이 발생하기 때문이다.</p>\\n<p>하지만 모두가 취업 준비를 하면 휩쓸리기 마련이다. 그나마 레벨 5의 초반에는 마지막 데모데이가 남아있어 함께 협업에 집중할 수 있었지만 그마저도 끝나고 난 뒤엔 모든 크루가 취업 준비에 열중했다. 오전부터 오후까지 이력서와 자소서를 두들기고, 면접 스터디라는 이름으로 서로 줄기차게 모의 면접을 진행하곤 했다.</p>\\n<p>이런 상황에 나라고 취업 준비를 안 할 수가 없었다. 언젠간 하게 될테니 미리 &#39;이 사람들과 함께 한다면 좋은 경험이겠거니&#39; 생각하고 함께 취준의 파도에 몸을 실었다.</p>\\n<h2 id=\\\"다시-야생에-던져진-사람들\\\">다시 야생에 던져진 사람들</h2>\\n<p>취준 기간동안 새삼스레 깨달은 점은, 내가 개발을 정말 좋아한다는 것이다. 이력서와 자소서를 쓰고 고치고 피드백 받고... 실컷 개발만 하다가 갑자기 나를 평가하고 증명하는 문서만 쳐다보고 있으려니 좀이 쑤셔 견디기가 어려웠다. 몰랐지만 우테코에 오기 전 다른 크루들의 화려한 경력들을 볼때면 상대적으로 초라한 내 이력서가 더 휑해보이고, 어딘지 모르게 우울했다. 아예 한게 없냐고 하면 그렇지는 않지만서도, 내용도 좋고 어필할 포인트도 많은 그런 이력서들을 보게되면 내 것과 비교하지 않을 수가 없다. <strong>모든것은 상대적인거니까.</strong></p>\\n<p>이 간단한 사실이 우아한형제들을 포함해 각종 난다긴다하는 회사들의 결과가 발표되기 시작하며 실감이 났다. 흔히 취준생들 사이에서 &quot;면접은 까보기 전까지 모른다.&quot; 라는 말을 하곤 하지만 생각과는 너무나도 달랐던 현실에 이해할 수 없는 불합리함을 느꼈다.</p>\\n<p>내가 면접관은 아니지만서도 당연히 붙을 줄 알았던, 누가봐도 개발 잘하고 열정 넘치고 협업 스킬도 빛나는 그런 크루들이 면접에서 줄줄이 떨어지는가 하면 생각지도 못했던 크루가 합격 결과를 받기도 했다. <em>(말 그대로 의외라서 그렇지 그 크루가 못한다는 의미는 절대 아니다.)</em> 지원자들의 시선에서는 보이지 않는 무언가가 면접관들의 눈에는 보였기 때문일까? 나는 아직도 잘 모르겠다.</p>\\n<p>원하는 기업에 한 번에 합격하면 얼마나 좋을까. 지난 기수의 취업률을 봐서인지 결과를 보기전까진 어련히 잘 가겠거니- 생각했었다. 하지만 그건 일종의 판타지라는 사실을 깨닫기까진 얼마 걸리지 않았다. 물론 누군가는 한 번 지원에 그대로 합격하기도 하겠지만 그렇지 않은 경우가 훨씬 많았다. 적어도 내가 본 사람들은 그랬다.</p>\\n<p>취준생들의 마음을 조금은 알 것 같다. 취준 기간이 길어질수록 시험당하고, 평가당하는 입장이 유쾌할리가 없는데. 이런 상황에서 다시 학교로 돌아가는 입장인게 한 편으로는 다행이라는 생각까지 들 줄 누가 알았을까.</p>\\n<p>확실히 겨울이 오긴 했나보다. 야생의 겨울은 유난히 추웠다.</p>\\n<h2 id=\\\"중요한건-꺾이지-않는-마음\\\">중요한건 꺾이지 않는 마음</h2>\\n<p>추운 겨울이 왔다고 죽으란 법은 없다. 실패에 좌절하고, 때론 분노하면서도 다시금 일어나 의욕을 불태우는 사람들이기에 얼마 지나지 않아 자신의 자리를 찾을 것이란건 의심하지 않는다. 저마다의 목표를 위해 치열하게 버텨내며 상처입는 모습을 지켜보는건 마음이 아프지만, 여기서 한 계단 더 나아가려면 꼭 필요한 아픔이라고 생각한다. 고통 없이는 성장도 없는 법이기에.</p>\\n<p><img src=\\\"https://user-images.githubusercontent.com/28296575/207917913-022837c6-1094-4bc2-a561-efb0d983e2fb.png\\\" alt=\\\"지금의 아픔은 성장통일거야\\\"></p>\\n<p>글쓰기를 하며, 크루의 글을 읽고 코멘트를 남겼던게 문득 생각나서 가져와봤는데 지금의 우리에게도 적용되는 이야기인 것 같다. 앞으로도 많은 실패를 하게 될텐데 그때마다 실패에 주저앉고 돌아선다면 아무것도 배울 수 없을 것이다. 그러나 넘어진다고 해도 무언가를 주워서 일어난다면 적어도 성공적인 실패라고 부를 수 있지 않을까.</p>\\n<p>지금 이 순간에도 각자의 자리에서 치열하게 실패하고 있는 모두에게 응원을 보낸다.</p>\\n\";\n// Exports\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (code);//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/posts/4.md\n");

